import { Item } from '../types/Item';

export const items: Item[] = [
  { id: 0, date: new Date(2022, 8, 15), category: 'food', title: 'McDonalds', value: 32.12 },
  { id: 1, date: new Date(2022, 8, 15), category: 'food', title: 'Burger King', value: 28 },
  { id: 2, date: new Date(2022, 8, 16), category: 'rent', title: 'Aluguel Apt', value: 2300 },
  { id: 3, date: new Date(2022, 9, 18), category: 'salary', title: 'Salário ACME', value: 4500 },
];
